import sys
line = ''
for elem in range(len(line)):
    if elem == 0:
        if line[elem].islower() and line[elem+1].isupper():
            print(line[elem], end = " ")
    if elem>1 and elem<len(line)-1:
        if line[elem].islower():
            if line[elem-1].isupper() or line[elem+1].isupper():
                print(line[elem], end = " ") 
    if elem == len(line):
        if line[elem].islower() and line[elem-1].isupper():
            print(line[elem], end = " ")